import { useState } from 'react';

function App() {
  const [todos, setTodos] = useState([
    {
      text: 'x',
      isCompleted: false
    },
    {
      text: 'y',
      isCompleted: false
    },
    {
      text: 'y',
      isCompleted: false
    }
  ])

  function Todo({todo, index}) {

    return(
      <div className="todo">
        {todo.text}
      </div>
    )
  }

  return (
    <div className="App">
      <div className="todo-list">
        {todos.map((todo, index) => (
          <Todo key={index} index={index} todo={todo}/>
        ))} 
      </div>
    </div>
  );
}

export default App;
